import React from 'react'
import {Tile, Props as TileProps} from './tile.component'

declare type TileData=TileProps & {key:string}

export interface Props {
	tileContents:TileData[]
}


export class TileGrid extends React.Component<Props> {

  	render() {return (
		<div className="tileGrid">{
			this.props.tileContents.map((tile)=>
				<Tile key={tile.key} content={tile.content} />
			)
		}</div>  
  	)}

}

export default TileGrid
